import{_ as e,o,c as t,O as a}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 23.1-227 Laws of the Commonwealth to apply to contracts.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-227.md","filePath":"vacode/23.1-227.md"}'),r={name:"vacode/23.1-227.md"},n=a('<h1 id="§-23-1-227-laws-of-the-commonwealth-to-apply-to-contracts" tabindex="-1">§ 23.1-227 Laws of the Commonwealth to apply to contracts. <a class="header-anchor" href="#§-23-1-227-laws-of-the-commonwealth-to-apply-to-contracts" aria-label="Permalink to &quot;§ 23.1-227 Laws of the Commonwealth to apply to contracts.&quot;">​</a></h1><p>The laws of the Commonwealth shall govern any agreement, contract, or instrument of indebtedness executed between a postsecondary school and any person who enrolls in any course or program offered or to be offered by such school in the Commonwealth or any person who is employed or offered employment by such school in the Commonwealth.</p><p>Code 1950, § 23-276; 1980, c. 658; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0178" target="_blank" rel="noreferrer">178</a>, § 23-276.11; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0991" target="_blank" rel="noreferrer">991</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0447" target="_blank" rel="noreferrer">447</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>; 2017, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0314" target="_blank" rel="noreferrer">314</a>.</p>',3),l=[n];function c(s,i,h,p,f,_){return o(),t("div",null,l)}const g=e(r,[["render",c]]);export{d as __pageData,g as default};
